import React from 'react'

import {
    Col, Card, CardTitle, CardText, Button
} from 'reactstrap'

import { FaTrash } from 'react-icons/fa6'

const NoteCard = ({ note }) => {
    console.log("Note card");
    
    const { _id, title, content } = note;
    log.info();
    return (

        <Col sm={3}>

            <Card body className='NoteCard'>
                <CardTitle tag="h5">
                    {title}
                    <Button className='DeleteNote bg-danger border-0'>
                        <FaTrash></FaTrash>
                    </Button>
                </CardTitle>
                <CardText>
                    {content}
                </CardText>
            </Card>
        </Col>
    )
}

export default NoteCard
